            const base_url = '<?php echo base_url() ?>';

            // fungsi untuk memanggil menu camera
            var panggilCamera = function() {

                // init webcam
                Webcam.set({

                    width: 320,
                    height: 240,
                    image_format: "jpeg",
                    jpeg_quality: 90

                });

                Webcam.attach("#webcam");
            }


            var jalankanCapture = function() {

                $('#msg').text("Sedang melakukan testing . . .");
                
                // nilai random
                filename = "test_percobaan";

                // capture file        
                Webcam.snap(function( data ) {

                    Webcam.upload(data, '<?php echo base_url('informasi/proses_upload_testing/') ?>'+ filename, function(code, text) {
                            
                    });
                })



                $.ajax({

                    type: "GET",
                    url: "<?php echo base_url('informasi/proses_klasifikasi/') ?>" + filename,
                    dataType: "json",
                    success: function( response ) {

                        $('#msg').text("Hasil " + response.label);
                        // $('#proses-registrasi').hide(500);
                    }, error: function( e ) {

                        console.log( e );
                    }
                })
            }




            $('#launch-camera').click(function() {

                starter.hide(500);
                camera.show(1000)

                // jalankan camera (ON)
                panggilCamera();

            });


            $('#proses-klasifikasi').click(function() {

                jalankanCapture();

                
            });


            
        })
        </script>

